	public static ArrayList<String> select(String Query) throws Exception{
		try {
			Connection con = getConnection();						
			String emp_no = "",birth_date = "",first_name = "",last_name = "",gender = "",hire_date = "",salary = "",from_date = "",to_date = "";
			PreparedStatement statement = con.prepareStatement(Query);
			ResultSet result = statement.executeQuery();
			ArrayList<String> arr = new ArrayList<String>();
			
			while(result.next()) {
				boolean f = false;
				if(Query.toUpperCase().contains("employees".toUpperCase()))
				{
				 f = true;	
				 emp_no = result.getString("emp_no");
				 birth_date = result.getString("birth_date");
				 first_name = result.getString("first_name");
				 last_name = result.getString("last_name");
				 gender = result.getString("gender");
				 hire_date = result.getString("hire_date");
				}
				if(Query.toUpperCase().contains("salaries".toUpperCase()))
				{
				 if (f == false) {	
				 emp_no = result.getString("emp_no");
				 }
				 salary = result.getString("salary");
				 from_date = result.getString("from_date");
				 to_date = result.getString("to_date");
				}
				String str = emp_no + " " + birth_date + " " + first_name + " " + last_name + " " + gender + " " + hire_date + " " + salary + " " + from_date + " " + to_date;
				arr.add(str);
				
			       
			}			
			return arr;
		}catch(Exception e)
		{
			System.out.println(e);
		}
		return null;
	}
	
